import React from 'react';
import Hero from './components/Hero';
import Features from './components/Features';
import Schedule from './components/Schedule';

function Header() {
  return (
    <div className="App">
          <Header />
          <Hero />
          <Features />
          <Schedule />
    </div>
  );
}

export default Header;
